import React,{component} from "react"

  class Owner extends React.Component {
    onSubmitHandler = (e) => {
        e.preventDefault();
       this.props.history.push('./component/Sample')
      }
    render() { 
        return <React.Fragment>
                <form onSubmit={this.onSubmitHandler}>
                     <h1>Hello</h1>
                     <input type="submit"/>
                </form>
            
        </React.Fragment>;
    }
}
 
export default Owner;
